import {Link} from "react-router-dom";
import login from './login';


function  Header(){

    return(
        <div>
          <div className="header"> 
          <span>Sell & Purhcase</span>
          <Link to="login"><login></login></Link>
          </div>
        </div>
    );
}

export default  Header;
